import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Form, Button } from 'react-bootstrap';
function Auth () {
    return (
        <div className="Auth d-flex flex-column justify-content-center align-items-center vh-100">
            <h2 className="mb-3">Регистрация</h2>
            <Form style={{ maxWidth: '500px', width: '100%' }}>
                <Form.Group className="mt-3" controlId="formBasicName">
                <Form.Label>Введите имя</Form.Label>
                <Form.Control type="text" placeholder="Введите имя" />
                </Form.Group>

                <Form.Group className="mt-3" controlId="formBasicEmail">
                <Form.Label>Введите email</Form.Label>
                <Form.Control type="email" placeholder="Введите email" />
                </Form.Group>

                <Form.Group className="mt-3" controlId="formBasicPassword">
                <Form.Label>Введите пароль</Form.Label>
                <Form.Control type="password" placeholder="Введите пароль" />
                </Form.Group>

                <Button className="mt-3" variant="primary" type="submit">
                Зарегистрироваться
                </Button>
            </Form>
        </div>
    );
}


export default Auth;
